import "./App.css";
import * as React from "react";
import { Button } from "@mui/base/Button";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button>hello</Button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
